package com.evergent.corejava.generalprogramming;

public class pattern5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		 int count=26;
		for(int i=1;i<=5;i++) {
			for(int j=1;j<=5;j++) {
				count-=1;
				System.out.print(count);
			}
			System.out.println();
		}

	}

}
